pub enum Version {

    /// `core` glsl
    Desktop(u16),

    /// `es` glsl
    Embedded(u16),
}

pub enum Error {

    /// A error occurred while writing to the output
    #[error("Io error: {0}")]
    IoError(
            #[from]
            IoError),

    /// The [`Module`](crate::Module) failed type resolution
    #[error("Type error: {0}")]
    Type(
         #[from]
         ResolveError),

    /// The specified [`Version`](Version) doesn't have all required [`Features`](super)
    ///
    /// Contains the missing [`Features`](Features)
    #[error("The selected version doesn't support {0:?}")]
    MissingFeatures(Features),

    /// [`StorageClass::PushConstant`](crate::StorageClass::PushConstant) was used and isn't
    /// supported in the glsl backend
    #[error("Push constants aren't supported")]
    PushConstantNotSupported,

    /// The specified [`Version`](Version) isn't supported
    #[error("The specified version isn't supported")]
    VersionNotSupported,

    /// The entry point couldn't be found
    #[error("The requested entry point couldn't be found")]
    EntryPointNotFound,

    /// A call was made to an unsupported external
    #[error("A call was made to an unsupported external: {0}")]
    UnsupportedExternal(String),

    /// A scalar with an unsupported width was requested
    #[error("A scalar with an unsupported width was requested: {0:?} {1:?}")]
    UnsupportedScalar(ScalarKind, Bytes),

    /// [`Interpolation::Patch`](crate::Interpolation::Patch) isn't supported
    #[error("Patch interpolation isn't supported")]
    PatchInterpolationNotSupported,

    /// A image was used with multiple samplers, this isn't supported
    #[error("A image was used with multiple samplers")]
    ImageMultipleSamplers,

    #[error("{0}")]
    Custom(String),
}

pub enum Error {

    #[error("one of the required capabilities {0:?} is missing")]
    MissingCapabilities(Vec<spirv::Capability>),

    #[error("unimplemented {0:}")]
    FeatureNotImplemented(&'static str),
}

pub enum ResolveError {

    #[error("Invalid index into array")]
    InvalidAccessIndex,

    #[error("Function {name} not defined")]
    FunctionNotDefined {
        name: String,
    },

    #[error("Function without return type")]
    FunctionReturnsVoid,

    #[error("Type is not found in the given immutable arena")]
    TypeNotFound,

    #[error("Incompatible operand: {op} {operand}")]
    IncompatibleOperand {
        op: String,
        operand: String,
    },

    #[error("Incompatible operands: {left} {op} {right}")]
    IncompatibleOperands {
        op: String,
        left: String,
        right: String,
    },
}

pub enum LocalVariableError {

    #[error("Initializer doesn't match the variable type")]
    InitializerType,
}

pub enum ValidationError {

    #[error("Type {handle:?} '{name}' is invalid: {error:?}")]
    Type {
        handle: Handle<crate::Type>,
        name: String,
        error: TypeError,
    },

    #[error("Constant {handle:?} '{name}' is invalid: {error:?}")]
    Constant {
        handle: Handle<crate::Constant>,
        name: String,
        error: ConstantError,
    },

    #[error("Global variable {handle:?} '{name}' is invalid: {error:?}")]
    GlobalVariable {
        handle: Handle<crate::GlobalVariable>,
        name: String,
        error: GlobalVariableError,
    },

    #[error("Function {0:?} is invalid: {1:?}")]
    Function(Handle<crate::Function>, FunctionError),

    #[error("Entry point {name} at {stage:?} is invalid: {error:?}")]
    EntryPoint {
        stage: crate::ShaderStage,
        name: String,
        error: EntryPointError,
    },

    #[error("Module is corrupted")]
    Corrupted,
}

pub enum ConservativeDepth {

    /// Shader may rewrite depth only with a value greater than calculated;
    GreaterEqual,

    /// Shader may rewrite depth smaller than one that would have been written without the modification.
    LessEqual,

    /// Shader may not rewrite depth value.
    Unchanged,
}

pub enum StorageClass {

    /// Function locals.
    Function,

    /// Pipeline input, per invocation.
    Input,

    /// Pipeline output, per invocation, mutable.
    Output,

    /// Private data, per invocation, mutable.
    Private,

    /// Workgroup shared data, mutable.
    WorkGroup,

    /// Uniform buffer data.
    Uniform,

    /// Storage buffer data, potentially mutable.
    Storage,

    /// Opaque handles, such as samplers and images.
    Handle,

    /// Push constants.
    PushConstant,
}

pub enum VectorSize {

    /// 2D vector
    Bi = ,

    /// 3D vector
    Tri = ,

    /// 4D vector
    Quad = ,
}

pub enum ScalarKind {

    /// Signed integer type.
    Sint,

    /// Unsigned integer type.
    Uint,

    /// Floating point type.
    Float,

    /// Boolean type.
    Bool,
}

pub enum ArraySize {

    /// The array size is constant.
    Constant(Handle<Constant>),

    /// The array size can change at runtime.
    Dynamic,
}

pub enum Interpolation {

    /// The value will be interpolated in a perspective-correct fashion.
    /// Also known as "smooth" in glsl.
    Perspective,

    /// Indicates that linear, non-perspective, correct
    /// interpolation must be used.
    /// Also known as "no_perspective" in glsl.
    Linear,

    /// Indicates that no interpolation will be performed.
    Flat,

    /// Indicates a tessellation patch.
    Patch,

    /// When used with multi-sampling rasterization, allow
    /// a single interpolation location for an entire pixel.
    Centroid,

    /// When used with multi-sampling rasterization, require
    /// per-sample interpolation.
    Sample,
}

pub enum ImageDimension {

    /// 1D image
    D1,

    /// 2D image
    D2,

    /// 3D image
    D3,

    /// Cube map
    Cube,
}

pub enum ImageClass {

    /// Regular sampled image.
    Sampled {
        /// Kind of values to sample.
        kind: ScalarKind,
        multi: bool,
    },

    /// Depth comparison image.
    Depth,

    /// Storage image.
    Storage(StorageFormat),
}

pub enum TypeInner {

    /// Number of integral or floating-point kind.
    Scalar {
        kind: ScalarKind,
        width: Bytes,
    },

    /// Vector of numbers.
    Vector {
        size: VectorSize,
        kind: ScalarKind,
        width: Bytes,
    },

    /// Matrix of floats.
    Matrix {
        columns: VectorSize,
        rows: VectorSize,
        width: Bytes,
    },

    /// Pointer to a value.
    Pointer {
        base: Handle<Type>,
        class: StorageClass,
    },

    /// Homogenous list of elements.
    Array {
        base: Handle<Type>,
        size: ArraySize,
        stride: Option<NonZeroU32>,
    },

    /// User-defined structure.
    Struct {
        block: bool,
        members: Vec<StructMember>,
    },

    /// Possibly multidimensional array of texels.
    Image {
        dim: ImageDimension,
        arrayed: bool,
        class: ImageClass,
    },

    /// Can be used to sample values from images.
    Sampler {
        comparison: bool,
    },
}

pub enum ConstantInner {
    Scalar {
        width: Bytes,
        value: ScalarValue,
    },
    Composite {
        ty: Handle<Type>,
        components: Vec<Handle<Constant>>,
    },
}

pub enum Binding {

    /// Built-in shader variable.
    BuiltIn(BuiltIn),

    /// Indexed location.
    Location(u32),

    /// Binding within a resource group.
    Resource {
        group: u32,
        binding: u32,
    },
}

pub enum SampleLevel {
    Auto,
    Zero,
    Exact(Handle<Expression>),
    Bias(Handle<Expression>),
    Gradient {
        x: Handle<Expression>,
        y: Handle<Expression>,
    },
}

pub enum Expression {

    /// Array access with a computed index.
    Access {
        base: Handle<Expression>,
        index: Handle<Expression>,
    },

    /// Array access with a known index.
    AccessIndex {
        base: Handle<Expression>,
        index: u32,
    },

    /// Constant value.
    Constant(Handle<Constant>),

    /// Composite expression.
    Compose {
        ty: Handle<Type>,
        components: Vec<Handle<Expression>>,
    },

    /// Reference a function parameter, by its index.
    FunctionArgument(u32),

    /// Reference a global variable.
    GlobalVariable(Handle<GlobalVariable>),

    /// Reference a local variable.
    LocalVariable(Handle<LocalVariable>),

    /// Load a value indirectly.
    Load {
        pointer: Handle<Expression>,
    },

    /// Sample a point from a sampled or a depth image.
    ImageSample {
        image: Handle<Expression>,
        sampler: Handle<Expression>,
        coordinate: Handle<Expression>,
        array_index: Option<Handle<Expression>>,
        offset: Option<Handle<Constant>>,
        level: SampleLevel,
        depth_ref: Option<Handle<Expression>>,
    },

    /// Load a texel from an image.
    ImageLoad {
        image: Handle<Expression>,
        coordinate: Handle<Expression>,
        array_index: Option<Handle<Expression>>,
        /// For storage images, this is None.
        /// For sampled images, this is the Some(Level).
        /// For multisampled images, this is Some(Sample).
        index: Option<Handle<Expression>>,
    },

    /// Apply an unary operator.
    Unary {
        op: UnaryOperator,
        expr: Handle<Expression>,
    },

    /// Apply a binary operator.
    Binary {
        op: BinaryOperator,
        left: Handle<Expression>,
        right: Handle<Expression>,
    },

    /// Select between two values based on a condition.
    Select {
        /// Boolean expression
        condition: Handle<Expression>,
        accept: Handle<Expression>,
        reject: Handle<Expression>,
    },

    /// Compute the derivative on an axis.
    Derivative {
        axis: DerivativeAxis,
        expr: Handle<Expression>,
    },

    /// Call a relational function.
    Relational {
        fun: RelationalFunction,
        argument: Handle<Expression>,
    },

    /// Call a math function
    Math {
        fun: MathFunction,
        arg: Handle<Expression>,
        arg1: Option<Handle<Expression>>,
        arg2: Option<Handle<Expression>>,
    },

    /// Cast a simply type to another kind.
    As {
        /// Source expression, which can only be a scalar or a vector.
        expr: Handle<Expression>,
        /// Target scalar kind.
        kind: ScalarKind,
        /// True = conversion needs to take place; False = bitcast.
        convert: bool,
    },

    /// Call another function.
    Call {
        function: Handle<Function>,
        arguments: Vec<Handle<Expression>>,
    },

    /// Get the length of an array.
    ArrayLength(Handle<Expression>),
}

pub enum Statement {

    /// A block containing more statements, to be executed sequentially.
    Block(Block),

    /// Conditionally executes one of two blocks, based on the value of the condition.
    If {
        condition: Handle<Expression>,
        accept: Block,
        reject: Block,
    },

    /// Conditionally executes one of multiple blocks, based on the value of the selector.
    Switch {
        selector: Handle<Expression>,
        cases: Vec<SwitchCase>,
        default: Block,
    },

    /// Executes a block repeatedly.
    Loop {
        body: Block,
        continuing: Block,
    },

    /// Exits the loop.
    Break,

    /// Skips execution to the next iteration of the loop.
    Continue,

    /// Returns from the function (possibly with a value).
    Return {
        value: Option<Handle<Expression>>,
    },

    /// Aborts the current shader execution.
    Kill,

    /// Stores a value at an address.
    Store {
        pointer: Handle<Expression>,
        value: Handle<Expression>,
    },
}
